	<p>–ö–æ–ª—ñ—Ä –æ—á–µ–π:. –ö–∞—Ä—ñ  –°—ñ—Ä—ñ  –ë–ª–∞–∫–∏—Ç–Ω—ñ  –ó–µ–ª–µ–Ω—ñ  –ß–æ—Ä–Ω—ñ  –Ü–Ω—à—ñ  –û–¥—Ä—É–∂–µ–Ω–∏–π, –∂–∏–≤–µ–º–æ –æ–∫—Ä–µ–º–æ  –í—Å–µ —Å–∫–ª–∞–¥–Ω–æ  –ß–∏ —î –¥—ñ—Ç–∏:. –î—ñ—Ç–µ–π –Ω–µ–º–∞—î, –∞–ª–µ —Ö–æ—Ç—ñ–ª–æ—Å—è –±  –î—ñ—Ç–∏ —î, –±—ñ–ª—å—à–µ –Ω–µ —Ö–æ—á—É  –î—ñ—Ç–∏ —î, —Ö–æ—á—É —â–µ  –î—ñ—Ç–µ–π –Ω–µ–º–∞—î, –Ω–µ —Ö–æ—á—É  –†–µ–ª—ñ–≥—ñ–π–Ω—ñ –ø–æ–≥–ª—è–¥–∏:. –Ü–Ω—Ç–µ—Ä–µ—Å–∏ —ñ —Ö–æ–±—ñ. –ù—ñ—á–æ–≥–æ –Ω–µ –∑–Ω–∞–π–¥–µ–Ω–æ. –ê–≤—Ç–æ–º–æ–±—ñ–ª—ñ  –ë–∞–Ω—è  –ù–µ—Ä–æ–±—Å—Ç–≤–æ  –ë–ª–∞–≥–æ–ø–æ–ª—É—á—á—è  –ë–ª–æ–Ω–¥–∏–Ω–∫–∏  –ú–∞–π–±—É—Ç–Ω—î  –í–µ—Å–µ–ª—ñ –∫–æ–º–ø–∞–Ω—ñ—ó  –í–µ—Å–Ω–∞  –í–µ—á—ñ—Ä–Ω—ñ –ø—Ä–æ–≥—É–ª—è–Ω–∫–∏  –í–∑–∞—î–º–Ω—ñ—Å—Ç—å  –í–∑–∞—î–º–æ–≤—ñ–¥–Ω–æ—Å–∏–Ω–∏  –í–∏–Ω–æ  –í—ñ—Å–∫—ñ  –°–º–∞—á–Ω–æ –ø–æ—ó—Å—Ç–∏  –í–æ–¥–∏—Ç–∏ –∞–≤—Ç–æ–º–æ–±—ñ–ª—å  –í–∏—Ö–æ–≤–∞–Ω–Ω—è –¥—ñ—Ç–µ–π  –í—Å–µ—Å–≤—ñ—Ç  –ó—É—Å—Ç—Ä—ñ—á–∞—Ç–∏—Å—è –∑ –¥—Ä—É–∑—è–º–∏  –ì–∞—Ä–º–æ–Ω—ñ—è  –ì–æ—Ä–∏  –ì—É–ª—è—Ç–∏  –î–∞—á–∞  –†—É—Ö  –î—ñ–≤—á–∞—Ç–∞  –ì—Ä–æ—à—ñ  –î—ñ—Ç–∏  –î–æ–±—Ä–æ—Ç–∞  –î–æ—â  –î–æ–º–∞—à–Ω—ñ–π –∑–∞—Ç–∏—à–æ–∫  –î—Ä–∞–π–≤  –î—Ä—É–∂–±–∞  –î—É–º–∞—Ç–∏  –î—É—à–∞  –î—É—à–µ–≤–Ω–∞ —Ä—ñ–≤–Ω–æ–≤–∞–≥–∞  –ñ—ñ–Ω–∫–∏  –ó–∞—Å–º–∞–≥–∞—Ç–∏  –ó–∞—Ö–æ–¥–∏  –ó—ñ—Ä–∫–∏  –ó–¥–æ—Ä–æ–≤–∏–π —Å–ø–æ—Å—ñ–± –∂–∏—Ç—Ç—è  –ó–µ–ª–µ–Ω–∏–π —á–∞–π  –ó–∏–º–∞  –ó–Ω–∞–Ω–Ω—è  –©–∏—Ä—ñ—Å—Ç—å  –ú–∏—Å—Ç–µ—Ü—Ç–≤–æ  –ö–∞—Ä–∞–æ–∫–µ  –ö–∞—Ä'—î—Ä–∞  –ü–æ–ª—É–Ω–∏—Ü—è  –ö–ª—É–±–∏  –ö–Ω–∏–≥–∏  –¶—É–∫–µ—Ä–∫–∏  –ö–æ—Å–º–æ—Å  –ö—Ä–∞—Å–∏–≤–µ –∂–∏—Ç—Ç—è  –ö—Ä–∞—Å–∞  –ö—É—Ä–∏—Ç–∏  –ö–æ—Ö–∞—Ç–∏  –ú—Ä—ñ—è—Ç–∏  –°–≤—ñ—Ç  –ú–æ—Ä–µ  –ß–æ–ª–æ–≤—ñ–∫–∏  –ù–∞—É–∫–∞  –ù–æ–≤—ñ –≤—Ä–∞–∂–µ–Ω–Ω—è  –ù–æ–≤—ñ –∑–Ω–∞–π–æ–º—Å—Ç–≤–∞  –ù—ñ—á–Ω–µ –º—ñ—Å—Ç–æ  –°–ø—ñ–ª–∫—É–≤–∞–Ω–Ω—è  –°–∞–º–æ—Ç–Ω—ñ—Å—Ç—å  –û–∫–µ–∞–Ω  –û—Å—ñ–Ω—å  –í—ñ–¥–ø–æ—á–∏–Ω–æ–∫  –°–ø—ñ–≤–∞—Ç–∏  –ü–∏–≤–æ  –ü—ñ—Ü–∞  –ü–ª–∞–≤–∞—Ç–∏  –ü–æ—à—É–∫ —Å–µ–Ω—Å—É –∂–∏—Ç—Ç—è  –ü–æ–ª—ñ—Ç–∏–∫–∞  –ü—Ä–∏–≥–æ–¥–∏  –ü—Ä–∏—Ä–æ–¥–∞  –ü–æ–¥–æ—Ä–æ–∂—É–≤–∞—Ç–∏  –ü—Ä–∞—Ü—é–≤–∞—Ç–∏  –ú–∞–ª—é–≤–∞—Ç–∏  –†–æ–º–∞–Ω—Ç–∏–∫–∞  –°–∞–º–æ–ø—ñ–∑–Ω–∞–Ω–Ω—è  –°–∞–º–æ—Ä–µ–∞–ª—ñ–∑–∞—Ü—ñ—è  –°–∞–º–æ–≤–¥–æ—Å–∫–æ–Ω–∞–ª–µ–Ω–Ω—è  –°–≤–æ–±–æ–¥–∞  –†–æ–¥–∏–Ω–∞  –®–≤–∏–¥–∫—ñ—Å—Ç—å  –°–æ–ª–æ–¥–∫–µ  –°–æ–Ω  –°—Ç–∞–±—ñ–ª—å–Ω—ñ—Å—Ç—å  –©–∞—Å—Ç—è  –°—é—Ä–ø—Ä–∏–∑–∏  –¢–≤–æ—Ä—á—ñ—Å—Ç—å  –¢–∏—à–∞  –î—ñ–∑–Ω–∞–≤–∞—Ç–∏—Å—è –Ω–æ–≤–µ  –ü–æ—Å–º—ñ—Ö–∞—Ç–∏—Å—è  –í—á–∏—Ç–∏—Å—è  –§—Ä—É–∫—Ç–∏  –ß–æ–ª–æ–≤—ñ–∫  –ß–µ—Å–Ω—ñ—Å—Ç—å  –ß–∏—Ç–∞–Ω–Ω—è  –®–∞—à–ª–∏–∫  –®–æ–ø—ñ–Ω–≥  –Ü–Ω—à—ñ —ñ–Ω—Ç–µ—Ä–µ—Å–∏  –ö—ñ–Ω–æ –≤—ñ–¥–µ–æ —ñ TV:.</p>
<p>–ê–≤–∞–Ω–≥–∞—Ä–¥–Ω–µ –∫—ñ–Ω–æ  –ê–≤—Ç–æ—Ä—Å—å–∫–µ –∫—ñ–Ω–æ  –ê—Ä—Ç—Ö–∞—É—Å  –ë–ª–æ–∫–±–∞—Å—Ç–µ—Ä–∏  –ë–æ–π–æ–≤–∏–∫–∏  –í–µ—Å—Ç–µ—Ä–Ω–∏  –í—ñ–π—Å—å–∫–æ–≤—ñ —Ñ—ñ–ª—å–º–∏  –î–µ—Ç–µ–∫—Ç–∏–≤–∏  –î–∂–µ–π–º—Å –ë–æ–Ω–¥  –î–æ–∫—É–º–µ–Ω—Ç–∞–ª—å–Ω–µ –∫—ñ–Ω–æ  –ì—Ä–∞ –ø—Ä–µ—Å—Ç–æ–ª—ñ–≤  –Ü–Ω–¥—ñ–π—Å—å–∫–µ –∫—ñ–Ω–æ  –Ü–Ω—Ç–µ–ª–µ–∫—Ç—É–∞–ª—å–Ω–µ –∫—ñ–Ω–æ  –Ü—Å—Ç–æ—Ä–∏—á–Ω—ñ —Ñ—ñ–ª—å–º–∏  –ö–æ–º–µ–¥—ñ—ó  –ö–æ—Ä–æ—Ç–∫–æ–º–µ—Ç—Ä–∞–∂–Ω–µ –∫—ñ–Ω–æ  –ö—Ä–∏–º—ñ–Ω–∞–ª—å–Ω—ñ —Ñ—ñ–ª—å–º–∏  –ö—Ö–∞–ª –î—Ä–æ–≥–æ  –ú–µ–ª–æ–¥—Ä–∞–º–∏  –ú—ñ—Å—Ç–∏—á–Ω–µ –∫—ñ–Ω–æ  –ú–æ–ª–æ–¥—ñ–∂–Ω—ñ –∫–æ–º–µ–¥—ñ—ó  –ü—Ä–∏–≥–æ–¥–Ω–∏—Ü—å–∫—ñ —Ñ—ñ–ª—å–º–∏  –ú—É–ª—å—Ç—Ñ—ñ–ª—å–º–∏  –ú—é–∑–∏–∫–ª–∏  –ù—ñ–º–µ –∫—ñ–Ω–æ  –í—ñ—Ç—á–∏–∑–Ω—è–Ω—ñ —Ñ—ñ–ª—å–º–∏  –ü—Å–∏—Ö–æ–ª–æ–≥—ñ—á–Ω—ñ –¥—Ä–∞–º–∏  –ü—Å–∏—Ö–æ–ª–æ–≥—ñ—á–Ω—ñ —Ç—Ä–∏–ª–µ—Ä–∏  –†–æ–º–∞–Ω—Ç–∏—á–Ω—ñ —Ñ—ñ–ª—å–º–∏  –†–æ—Å—ñ–π—Å—å–∫—ñ —Ñ—ñ–ª—å–º–∏  –°—ñ–º–µ–π–Ω–µ –∫—ñ–Ω–æ  –°–µ—Ä—ñ–∞–ª–∏  –†–∞–¥—è–Ω—Å—å–∫–µ –∫—ñ–Ω–æ  –¢–µ–æ—Ä—ñ—è –≤–µ–ª–∏–∫–æ–≥–æ –≤–∏–±—É—Ö—É  –¢—Ä–∞–≥—ñ–∫–æ–º–µ–¥—ñ—ó  –¢—Ä–∏–ª–µ—Ä–∏  –§–∞–Ω—Ç–∞—Å—Ç–∏—á–Ω—ñ —Ñ—ñ–ª—å–º–∏  –§—ñ–ª—å–º–∏ –∂–∞—Ö—ñ–≤  –§–µ–Ω—Ç–µ–∑—ñ  –ß–æ—Ä–Ω–æ-–±—ñ–ª–µ –∫—ñ–Ω–æ  –≠–∫—à–µ–Ω–∏  –ï—Ä–æ—Ç–∏—á–Ω–µ –∫—ñ–Ω–æ  –Ü–Ω—à–µ  –ê–≤—Ç–æ—Ä—Å—å–∫–∞ –ø—ñ—Å–Ω—è  –ê–ª—å—Ç–µ—Ä–Ω–∞—Ç–∏–≤–Ω–∏–π —Ä–æ–∫  –ê—Ä—Ç-—Ä–æ–∫  –ë–ª—é–∑  –ë–æ—Å–∞-–Ω–æ–≤–∞  –ë—Ä—ñ—Ç-–ø–æ–ø  –í–æ–∫–∞–ª-—Ç—Ä–∞–Ω—Å  –ì–æ—Ç—ñ–∫-–º–µ—Ç–∞–ª  –ì–æ—Ç—ñ–∫-—Ä–æ–∫  –ì—Ä–∞–Ω–∂  –î–∞–±  –î–∂–∞–∑-—Ä–æ–∫  –î–∏–Ω–¥–∏-—Ä–æ–∫  –î–∏—Å–∫–æ  –î–∏—Å–∫–æ-—Ö–∞—É—Å  –î—Ä–∞–º-–Ω-–±–µ–π—Å  –î—É—Ö–æ–≤–Ω–∞ –º—É–∑–∏–∫–∞  –Ü–Ω–¥–∞—Å—Ç—Ä—ñ–∞–ª  –Ü–Ω—Å—Ç—Ä—É–º–µ–Ω—Ç–∞–ª—å–Ω–∞ –º—É–∑–∏–∫–∞  –ö–∞–Ω—Ç—Ä—ñ  –ö–ª–∞—Å–∏—á–Ω–∞ –º—É–∑–∏–∫–∞  –ö–ª—É–±–Ω–∞ –º—É–∑–∏–∫–∞  –õ–∞—Ç–∏–Ω–æ–∞–º–µ—Ä–∏–∫–∞–Ω—Å—å–∫–∞ –º—É–∑–∏–∫–∞  –õ–∞—É–Ω–∂  –õ–µ–≥–∫–∏–π —Ä–æ–∫  –ú–µ—Ç–∞–ª  –ú–µ—Ç–∞–ª–∫–æ—Ä  –ú—ñ–Ω—ñ–º–∞–ª  –ú—É–∑–∏–∫–∞ —Ö  –ù–∞—Ä–æ–¥–Ω–∞ –º—É–∑–∏–∫–∞  –ù—å—é –µ–π–¥–∂  –û–ø–µ—Ä–∞  –ü–∞–Ω–∫-—Ä–æ–∫  –ü–∞—É–µ—Ä –º–µ—Ç–∞–ª  –ü–æ–ø-–º—É–∑–∏–∫–∞  –ü–æ–ø-–ø–∞–Ω–∫  –ü–æ–ø-—Ä–æ–∫  –ü—Ä–æ–≥—Ä–µ—Å–∏–≤ —Ç—Ä–∞–Ω—Å  –ü—Ä–æ–≥—Ä–µ—Å–∏–≤ —Ö–∞—É—Å